import React from 'react';
import {CardDisplayV} from './src/CardWidget';

const cardData=[{
  header:"01.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
},
{
  header:"02.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
},
{
  header:"03.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
},
{
  header:"04.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
}];

