const titleStyles:any={
    color:'orange',
    display:'flex',
    alignItem:'center',
    justifyContent: 'center',
    textTransform: 'uppercase',
    fontSize:'45px',
    fontWeight: 'bold',
    marginBottom: '10px'
};

const subtitleStyles:any={
  display:'flex',
  alignItem:'center',
  justifyContent: 'center',
  textAlign:'center',
  fontWeight:'300',
  fontSize:'22px',
  marginLeft:'250px',
  marginRight:'250px',
  marginBottom:'40px'
}

const ContentHeaderStyles:any={
  fontWeight:'900',
  color:'orange',
  fontSize:'80px',
  marginTop:'5px',
}

const ContentTitleStyles:any={
  fontWeight:'bold',
  color:'black',
  textTransform: 'uppercase'
}


function App() {
  return (
    <div>
     <CardDisplayV
     title={"WE BRING THE BEST THINGS"}
     description={"Embrace a blockchain-powered platform to issue digital certificates, manage training batches, and simplify placement processes."}
     titleStyles={titleStyles}
     subtitleStyles={subtitleStyles}
     cardData={cardData}
     ContentHeaderStyles={ContentHeaderStyles}
     ContentTitleStyles={ContentTitleStyles}
     />
    </div>
  );
}

export default App;
